import React, { useState, useEffect } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEdit, faRocket, faSpinner } from '@fortawesome/free-solid-svg-icons';

const SdkComponent = (props) => {
  const { data } = props;
  const { project, industry_domains, funnel_stages, project_role, sdk_type } = data;

  const [loading, setLoading] = useState(true);
  const [deployed, setDeployed] = useState(false);

  useEffect(() => {
    // Simulating loading effect with a delay
    setTimeout(() => {
      setLoading(false);
    }, 1000);
  }, []);

  const handleDeployClick = () => {
    if (!loading) {
      setLoading(true);
      setTimeout(() => {
        setDeployed(true);
        setLoading(false);
      }, 1500);
    }
  };

  return (
    <div className={`w-full min-w-[250px] max-w-[350px] h-full min-h-[200px] max-h-[250px] flex flex-col justify-between bg-gradient-to-r from-blue-400 to-purple-500 m-4 p-6 rounded-lg shadow-md ${loading ? 'animate-pulse' : ''}`}>
      <div>
        <div className="flex justify-items-stretch items-center">
          <h1 className="text-2xl font-semibold text-white mb-2 mr-2">{loading ? 'Loading...' : project}</h1>
          {!loading && (
            <div className="flex items-center ml-auto">
              <a className="text-white text-sm underline hover:no-underline">
                Edit Project
              </a>
              <FontAwesomeIcon
                icon={faEdit}
                className="text-white text-xl sdk-project-edit ml-2"
              />
            </div>
          )}
        </div>
      </div>
      {!loading && (
        <>
          <div className="mt-2">
            <h1 className="text-xs text-blue-200 mb-1">Industry Domain:</h1>
            <h1 className="text-sm text-white mb-2">{industry_domains}</h1>
            <h1 className="text-xs text-blue-200 mb-1">Funnel Stages:</h1>
            <h1 className="text-sm text-white">{funnel_stages}</h1>
          </div>
          <div className="mt-2">
            <div className="flex justify-between">
              <h1 className="text-base text-white">{project_role}</h1>
              {!deployed ? (
                <button
                  onClick={handleDeployClick}
                  className={`${
                    loading ? 'cursor-not-allowed' : 'cursor-pointer'
                  } bg-blue-500 hover:bg-blue-600 text-white font-semibold py-2 px-6 rounded-md flex items-center`}
                >
                  {loading ? (
                    <>
                      <FontAwesomeIcon icon={faSpinner} spin className="text-white text-lg mr-2" />
                      <span>Deploying...</span>
                    </>
                  ) : (
                    <>
                      <FontAwesomeIcon icon={faRocket} className="text-white text-lg mr-2" />
                      <span>Deploy Now</span>
                    </>
                  )}
                </button>
              ) : (
                <div className="text-center">
                  <FontAwesomeIcon icon={faRocket} className="text-green-500 text-4xl mb-4" />
                  <p className="text-gray-600">Deployment successful!</p>
                </div>
              )}
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default SdkComponent;
